Q:

How to get the id of a div in Ember.js

I'm using Ember 1.0.1.  I have a list of items with the html
<div class="item" id="item-1">content</div>

and the js
App.ItemView = Ember.View.extend({
  item: null,
  content: null,
  actions: {
    setContent: function(content) {
      this.set('content', content);
    }
  }
});

I want to set the content of the div, and the content of the div is itself.

A:

If you want to select a group of items and get the corresponding item.id, you can use the data method:
App.ItemView = Ember.View.extend({
  item: null,
  content: null,
  actions: {
    setContent: function(content) {
      this.data('item.id', this.content.id);
    }
  }
});

In this case, the id will be the last one (in the array) that's selected. You can see it in action here: http://emberjs.jsbin.com/Nutox/2/edit
If you want to select an item, but only that one, you can use the dataBy method:
App.ItemView = Ember.View.extend({
  item: null,
  content: null,
  actions: {
    setContent: function(content) {
      this.dataBy('item.id', this.content.id);
    }
  }
});

