A:

When you add an item to an ArrayList, it is added at the end of the ArrayList. So when you try to grab the value of the "add" button from the "sub" button, you are actually grabbing the value of the last item in the ArrayList.
What you need to do is to create a new ArrayList with the items you want, and then add the "add" button to the end of the list.

